import{_ as n}from"./plugin-vue_export-helper-c27b6911.js";import{r as p,o as e,c as g,a as i,d as t,b as c,e as o}from"./app-1c5b5ce3.js";const r={},l=o('<p>大家好呀，我是楼仔。</p><p>上周推出了我们的开源项目「技术派」，大家好评如潮，很多同学都想学习这个项目，为了更好带大家一起飞，我们今天正式推出技术派的知识星球。</p><p>什么是知识星球呢？你可以理解为高品质社群，方便大家跟着我们一起学习。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605snjCLuia46Fmo5kVlR4KSWiaBsZDJFyblzpyWcIMmtvNfXiaZPZEibhFrPA/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h2 id="_01-星球介绍" tabindex="-1"><a class="header-anchor" href="#_01-星球介绍" aria-hidden="true">#</a> 01 星球介绍</h2><p>先来介绍下星球的三位联合创始人：</p><ul><li><strong>楼仔</strong>：8 年一线大厂后端经验（百度/小米/美团），技术派团队负责人，擅长高并发、架构、源码，有很强的项目/团队管理、职业规划能力。</li><li><strong>沉默王二</strong>：GitHub 星标 6400k+开源知识库《 Java 程序员进阶之路》作者，CSDN 两届博客之星，掘金/知乎 Java 领域优质创作者。</li><li><strong>一灰</strong>：担任过技术总监，大厂里搞架构、创业团队冲过浪的资深后端，主研 Java 技术栈，擅长架构设计、高并发、微服务等领域。</li></ul><p>再来介绍一下星球提供的服务内容：</p><ol><li>技术派项目学习教程，后续会采用连载的方式，让你从 0 到 1 也能搭建一套自己的网站</li><li>技术派项目答疑解惑，让你快速上手该项目，小白也能懂</li><li>向楼仔、二哥和大厂嘉宾 1 对 1 交流提问，告别迷茫</li><li>个人成长路线、职业规划和建议，帮助你有计划学习</li><li>简历修改建议，让你的简历也能脱颖而出，收获更多面试机会</li><li>分享硬核技术学习资料，比如 Spring 源码、高并发教程、JVM、架构选型等</li><li>分享面试资料，都是一些高频面试题</li><li>分享工作中好用的开发小工具，助你提升开发效率</li><li>分享工作中的踩坑经历，让你快速获取工作经验，少走很多弯路</li><li>需求方案、技术架构设计提供参考建议，对标大厂</li><li>回答每天球友的问题</li><li>一起学习打卡，楼仔帮你分析学习进度</li></ol><h2 id="_02-技术派教程-答疑" tabindex="-1"><a class="header-anchor" href="#_02-技术派教程-答疑" aria-hidden="true">#</a> 02 技术派教程&amp;答疑</h2><p>技术派教程是我们星球推出的主打服务项目。</p><p>整个系列教程，会教你如何从 0 到 1 去完成一个对标大厂的项目，预计会出 100 篇文章，共划分为 6 个模块。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605sbicZwr6CgIUvmHGds7gkicoAHAN4eFp6hdYFbbUq17bpovgNhB4NwRRQ/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>大厂篇：</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605so9VJAG0qV9noaOpdDGhVaeMcF3ep33Vx96ickMVZU8wAoBxhia9ibKmUw/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>进阶篇：</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605s6kDq5Ft9gqrXG4K2LqDELM2QvIPSNvehnrygYTbmXLVD2S7fQicnang/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>由于教程目录太长，就不一一罗列，知识星球中有完整的教程目录。</p><p>由于教程内容较多，不可能一次性写完，所以<strong>会采用连载的方式，将教程发布到知识星球中</strong>，该教程由 3 位合伙人一起撰写，我们会先选取里面最重要的 20 篇，在本月全部输出，也方面大家能快速入门学习。</p><p>对于技术派项目中遇到的问题，<strong>大家可以加入技术派的知识星球群，我们会给大家一一解答</strong>，即使你是小白，也完全不用担心。</p><h2 id="_03-成长答疑解惑" tabindex="-1"><a class="header-anchor" href="#_03-成长答疑解惑" aria-hidden="true">#</a> 03 成长答疑解惑</h2><p>其实楼仔在学习和成长的过程中，也曾焦虑过、迷茫过，如果你恰好和我一样，这里需要重点关注，就比如下面这位粉丝。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605sliclutbQHlianDjBFFavrN3icZFfjORJHudoF96IbgBicTyeOT1o8iaMJdw/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>如果你也一样，找楼仔不就得了。。。给大家看看楼仔这几年的学习计划（目前也都放到星球中）：</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605sCmukBK6u0tABhh8xj29hUnVPFGdnHvD7tqRVZFYIAvpNNpuRM2raqw/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>很多同学会问，楼哥，你怎么知道要学习这些内容呢？星球中其实已经给大家分享了后端技术栈需要掌握的全部知识，以及对应的学习资料，让你学习更有章法。</p><p>对于还在迷茫和焦虑，不知道如何规划自己学习路径、不知如何进行时间管理、或者有其它疑惑的同学，都可以在星球中给楼仔提问，我都会耐心回复大家。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605siav9PxpYP80IehRqCHoib48bAFXicKM49bXroziapOOODtiadbpHQvt0vRw/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>对于制定好学习计划的同学，可以在星球中打卡，定期同步学习进度，楼仔也会对你的学习进度进行纠偏哈。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605sbDeXosFxnJnlpAiaL1UpZBjurNQwqOMpE0mhnxns7pCRr4QibPqOpTFw/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h2 id="_04-有价值的资料" tabindex="-1"><a class="header-anchor" href="#_04-有价值的资料" aria-hidden="true">#</a> 04 有价值的资料</h2><p>星球中会提供大量有价值的学习资料，比如我之前面试大厂的一些笔记，都是我这几年实战的大厂面试题，真枪实弹！就靠这些面试题，拿到过百度、新浪、小米、美团、滴滴、陌陌的 Offer。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605sVdCyr2ETAAtiaqRoLtdrib3jTxicI8q86tq4IHBavpJZtpgckG53UIoeA/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>星球中还会提供其它大量有价值的学习资料，之前有一部分已经免费发放给大家，但是有一部分属于星球专属。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605stMibcTOI7FjMotVXexjvhUibLpRVFiceOhV1FAg7PC5NEyzkia7goUoxgw/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605sZibIrVlVjsibicJXCnju8QusicHMneARBnh9xuINdiadVEB9fAlqYuDRVMA/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h2 id="_05-简历-大厂项目文档" tabindex="-1"><a class="header-anchor" href="#_05-简历-大厂项目文档" aria-hidden="true">#</a> 05 简历&amp;大厂项目文档</h2><p>马上就到招聘季，我们也会帮大家一起修改简历，大家可以按照这个模板，将改好的简历发给我邮箱，我们会给你简历修改建议，让你能拿到更多面试机会。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605s5HibicR2YEhCms1a6vtr2CpxGZt9NDwBphyIsjbwR7b8U1qsb80zqKvw/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>楼仔这边也有很多大厂的资料，需求文档、方案设计文档、架构设计文档等，如果你需要这些大厂资料，我都会给你提供，包括你自己进行方案&amp;架构设计时，我们也会给你提供指导和建议。</p><h2 id="_06-如何加入星球" tabindex="-1"><a class="header-anchor" href="#_06-如何加入星球" aria-hidden="true">#</a> 06 如何加入星球？</h2><p>技术派的知识星球原价是 <strong>129</strong> 元，特地给大家申请了一波 30 元的优惠券，最后的优惠价是 <strong>99</strong> 元。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605s41AJKicu34cgNRvegYqgcDfYYtKVhXXu2tOUf1t1LHHzDuTic9Ra2oDw/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>可能有同学会说，你的星球有点贵，这个还真不一样，<strong>你需要看服务内容，并不是所有的星球，都有技术派这样的项目，都有我们这样专业的团队。</strong></p><p>之前就有粉丝报培训班，花费近 2 万，为了就是能在简历上能多一些项目经验，最后效果也不太理想。</p><p>我们这个星球，有项目、有技术、有个人计划、甚至连简历修改都包括，仅单简历修改这一项，外面至少也要 300 RMB，不信？大家可以自行百度。</p><p>之前我也经常给同事说，在你这个年龄，但凡有人像我指导你一样，去指导我，我就可以少走 3 年弯路，人的黄金时间，又有多少个 3 年呢？</p><p><strong>可以这么说，对于技术派提供的服务，只要有一项你需要，基本能赚回票价，绝对不会让粉丝们吃亏。</strong></p><p>大家时间都很宝贵，早上车一天，就少浪费一天时间。</p><figure><img src="https://mmbiz.qpic.cn/mmbiz_png/sXFqMxQoVLHzvzOFb0icXAlhktePz605s41AJKicu34cgNRvegYqgcDfYYtKVhXXu2tOUf1t1LHHzDuTic9Ra2oDw/640?wx_fmt=png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>一起加油，共勉！💪🏻</p>',51),s={href:"https://mp.weixin.qq.com/s/DdtEZ6f4VrFO_Ra6L2qo9g",target:"_blank",rel:"noopener noreferrer"};function m(f,z){const a=p("ExternalLinkIcon");return e(),g("div",null,[l,i("blockquote",null,[i("p",null,[t("参考链接："),i("a",s,[t("https://mp.weixin.qq.com/s/DdtEZ6f4VrFO_Ra6L2qo9g"),c(a)]),t("，出处：楼仔，整理：沉默王二")])])])}const d=n(r,[["render",m],["__file","jizpdzzxqktl.html.vue"]]);export{d as default};
